import React from "react";
import travelImage from "../../imgs/travel-stuff.jpg";
import "./Travel.css";

const travelInfo = [
  {
    id: 1,
    imageName: travelImage,
    alt: "Travel",
    date: "17 June 2025",
    title: "1. Passport/ID & Travel Documents ",
    text: "Always have your identification and necessary travel papers (boarding passes, hotel reservations, etc) on hand",
  },

  {
    id: 2,
    title: "2. Backpack",
    text: "It is important to choose the right backpack that will be useful during the entire travel. If you are planning for adventure tours that envolve a lot of activities, the backpack will make mobility easier for you.",
  },
];

function Travel() {
  return (
    <div className="travel-div">
      {travelInfo.map((travel) => (
        <section key={travel.id} className="travel-section">
          <img src={travel.imageName} alt={travel.alt} />
          <span>{travel.date}</span>
          <h3>{travel.title}</h3>
          <p>{travel.text}</p>
        </section>
      ))}
    </div>
  );
}

export default Travel;
